import React, { Component } from "react";
import axios from "axios";

import "./Blog.css";

class Blog extends Component {
  state = {
    posts: [],
    selectedPostId: null,
    error: false,
    search: "",
  };

  upddateSearch(event) {
    this.setState({ search: event.target.value.substr(0, 20) });
  }
  render() {
    return (
      <div className="Blog">
        <header>
          <nav>
            <ul>
              <li>
                <a href="/">Home Page</a>
              </li>
              <li>
                <a href="/new-post">New Record</a>
              </li>
            </ul>
          </nav>
        </header>
        <input
          type="text"
          value={this.state.search}
          onChange={this.upddateSearch.bind(this)}
        />
      </div>
    );
  }
}

export default Blog;
